DROP TABLE IF EXISTS `sales_data`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `sales_data` (
  `salesales_ids_id` int NOT NULL AUTO_INCREMENT,
  `order_date` date DEFAULT NULL,
  `stock_date` date DEFAULT NULL,
  `order_number` int DEFAULT NULL,
  `product_key` int DEFAULT NULL,
  `customer_key` int DEFAULT NULL,
  `order_line_item` int DEFAULT NULL,
  `order_quantity` int DEFAULT NULL,
  PRIMARY KEY (`salesales_ids_id`),
  KEY `fk_sales_product` (`product_key`),
  KEY `fk_sales_customer` (`customer_key`),
  CONSTRAINT `fk_sales_customer` FOREIGN KEY (`customer_key`) REFERENCES `customer_lookup` (`customer_id`),
  CONSTRAINT `fk_sales_product` FOREIGN KEY (`product_key`) REFERENCES `products_lookup` (`product_id`)
) ENGINE=InnoDB AUTO_INCREMENT=16384 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

