-- Step 2: Creating Analytical Tables for Different Metrics 
-- Here we create tables to analyze specific metrics and populate them with data from operational tables.

-- Analytical table for Asset Analysis
drop table if exists asset_analysis;
CREATE TABLE asset_analysis (
    asset_id INT PRIMARY KEY AUTO_INCREMENT,
    cash_assets DECIMAL(15, 2),
    inventory DECIMAL(15, 2),
    equipment DECIMAL(15, 2),
    accounts_receivable DECIMAL(15, 2),
    total_assets DECIMAL(15, 2),
    total_liabilities DECIMAL(15, 2),
    shareholder_equity DECIMAL(15, 2)
);
-- Captures various asset details for overall asset analysis

-- Insert data from the operational table for initial load
INSERT INTO asset_analysis (cash_assets, inventory, equipment, accounts_receivable, total_assets, total_liabilities, shareholder_equity)
SELECT cash_assets, inventory, equipment, accounts_receivable, total_assets, total_liabilities, shareholder_equity
FROM assets;
-- Populating asset data for immediate access to key asset metrics

-- Analytical table for Customer Demographics
drop table if exists customer_demographics;
CREATE TABLE customer_demographics (
    customer_id INT PRIMARY KEY,
    name VARCHAR(50),
    surname VARCHAR(50),
    age INT,
    education VARCHAR(50),
    city VARCHAR(50),
    marital_status VARCHAR(10)
);
-- Stores demographic information to analyze customer segments

-- Populate customer demographics table
INSERT INTO customer_demographics (customer_id, name, surname, age, education, city, marital_status)
SELECT customer_id, name, surname, age, education, city, marital_status
FROM customer_lookup;
-- Populates demographics table for customer analysis

-- Analytical table for Sales Time Trends
drop table if exists sales_time_trends;
CREATE TABLE sales_time_trends (
    sales_id INT PRIMARY KEY AUTO_INCREMENT,
    order_date DATE,
    stock_date DATE,
    order_number INT,
    product_key INT,
    customer_key INT,
    order_quantity INT
);
-- Stores sales data over time to analyze trends

-- Populate sales time trends table
INSERT INTO sales_time_trends (order_date, stock_date, order_number, product_key, customer_key, order_quantity)
SELECT order_date, stock_date, order_number, product_key, customer_key, order_quantity
FROM sales_data;
-- Populates sales data for time trend analysis

-- Analytical table for Product Performance
drop table if exists product_performance;
CREATE TABLE product_performance (
    product_id INT PRIMARY KEY,
    product_name VARCHAR(255),
    product_category_id INT,
    product_subcategory_id INT,
    product_cost DECIMAL(10, 2),
    product_price DECIMAL(10, 2),
    total_sales INT DEFAULT 0,
    total_revenue DECIMAL(15, 2) DEFAULT 0.00,
    total_returns INT DEFAULT 0
);
-- Tracks sales, revenue, and return metrics for products

-- Populate initial product data into the performance table
INSERT INTO product_performance (product_id, product_name, product_category_id, product_subcategory_id, product_cost, product_price)
SELECT p.product_id, p.product_name, ps.product_category_key, p.product_subcategory_key, p.product_cost, p.product_price
FROM products_lookup AS p
JOIN product_subcategories AS ps ON p.product_subcategory_key = ps.subcategory_id;
-- Populates product data for performance metrics analysis

-- Analytical table for Return Patterns
drop table if exists return_patterns;
CREATE TABLE return_patterns (
    return_id INT PRIMARY KEY AUTO_INCREMENT,
    product_id INT,
    return_date DATE,
    return_quantity INT,
    return_rate DECIMAL(5, 2) DEFAULT 0.00
);
-- Analyzes return rates by product to identify quality issues

-- Fill initial data from product_returns into return patterns table
INSERT INTO return_patterns (product_id, return_date, return_quantity)
SELECT product_key, return_date, return_quantity
FROM product_returns;
-- Populates return data for return rate analysis

-- Step 3: ETL (Extract, Transform, Load) - Stored Procedures for Analytics
-- In this section, we create stored procedures that perform analytical calculations on the tables.
-- Each procedure extracts relevant data, performs calculations (transformation), and presents it as a result set.
-- These procedures serve as the ETL layer in this static dataset setup, providing key metrics without modifying data.

-- Procedure to get a summary of total sales and revenue for each product
DROP PROCEDURE IF EXISTS product_sales_summary;
DELIMITER //

CREATE PROCEDURE product_sales_summary()
BEGIN
    -- Provides total sales and revenue for each product, ordered by revenue
    SELECT p.product_id, 
           p.product_name, 
           COALESCE(SUM(sd.order_quantity), 0) AS total_sales, 
           COALESCE(SUM(sd.order_quantity * p.product_price), 0) AS total_revenue
    FROM products_lookup AS p
    LEFT JOIN sales_data AS sd ON p.product_id = sd.product_key
    GROUP BY p.product_id, p.product_name
    ORDER BY total_revenue DESC;
END //

DELIMITER ;

-- Procedure to get customer demographic segmentation by city, age group, and marital status
DROP PROCEDURE IF EXISTS customer_demographics_report;
DELIMITER //

CREATE PROCEDURE customer_demographics_report()
BEGIN
    -- Segments customers by city, age group, and marital status
    SELECT city, 
           CASE 
               WHEN age < 25 THEN 'Under 25'
               WHEN age BETWEEN 25 AND 34 THEN '25-34'
               WHEN age BETWEEN 35 AND 44 THEN '35-44'
               WHEN age BETWEEN 45 AND 54 THEN '45-54'
               WHEN age >= 55 THEN '55+'
           END AS age_group,
           marital_status,
           COUNT(customer_id) AS customer_count
    FROM customer_demographics
    GROUP BY city, age_group, marital_status
    ORDER BY city, age_group;
END //

DELIMITER ;

-- Calculate the return rate for each product based on sales and returns
DROP PROCEDURE IF EXISTS product_return_analysis;
DELIMITER //

CREATE PROCEDURE product_return_analysis()
BEGIN
    -- Calculates return rate for each product and orders by highest return rate
    SELECT p.product_id,
           p.product_name,
           COALESCE(SUM(pr.return_quantity), 0) AS total_returns,
           COALESCE(SUM(sd.order_quantity), 0) AS total_sales,
           CASE 
               WHEN COALESCE(SUM(sd.order_quantity), 0) = 0 THEN 0
               ELSE (COALESCE(SUM(pr.return_quantity), 0) / COALESCE(SUM(sd.order_quantity), 1)) * 100
           END AS return_rate_percentage
    FROM products_lookup AS p
    LEFT JOIN product_returns AS pr ON p.product_id = pr.product_key
    LEFT JOIN sales_data AS sd ON p.product_id = sd.product_key
    GROUP BY p.product_id, p.product_name
    ORDER BY return_rate_percentage DESC;
END //

DELIMITER ;

-- Provide a monthly sales summary with quantity and revenue
DROP PROCEDURE IF EXISTS monthly_sales_summary;
DELIMITER //

CREATE PROCEDURE monthly_sales_summary()
BEGIN
    -- Summarizes total quantity sold and revenue by month
    SELECT DATE_FORMAT(order_date, '%Y-%m') AS month, 
           SUM(order_quantity) AS total_quantity_sold,
           SUM(order_quantity * p.product_price) AS total_revenue
    FROM sales_data AS sd
    JOIN products_lookup AS p ON sd.product_key = p.product_id
    GROUP BY month
    ORDER BY month;
END //

DELIMITER ;

-- Executing each stored procedure to verify functionality
CALL product_sales_summary();
CALL customer_demographics_report();
CALL product_return_analysis();
CALL monthly_sales_summary();

-- Step 4: Data Marts - Creating Views for Analysis
-- In this step, we define views (data marts) that provide targeted metrics for reporting.
-- These views allow easy querying of sales, customer demographics, return rates, and monthly trends.
-- Each data mart is designed to simplify access to specific analytical data.

CREATE OR REPLACE VIEW product_sales_mart AS
SELECT p.product_id, 
       p.product_name, 
       COALESCE(SUM(sd.order_quantity), 0) AS total_sales, 
       COALESCE(SUM(sd.order_quantity * p.product_price), 0) AS total_revenue
FROM products_lookup AS p
LEFT JOIN sales_data AS sd ON p.product_id = sd.product_key
GROUP BY p.product_id, p.product_name
ORDER BY total_revenue DESC;
-- Data mart for product sales, aggregating total sales and revenue per product

CREATE OR REPLACE VIEW customer_demographics_mart AS
SELECT city, 
       CASE 
           WHEN age < 25 THEN 'Under 25'
           WHEN age BETWEEN 25 AND 34 THEN '25-34'
           WHEN age BETWEEN 35 AND 44 THEN '35-44'
           WHEN age BETWEEN 45 AND 54 THEN '45-54'
           WHEN age >= 55 THEN '55+'
       END AS age_group,
       marital_status,
       COUNT(customer_id) AS customer_count
FROM customer_demographics
GROUP BY city, age_group, marital_status
ORDER BY city, age_group;
-- Data mart for customer demographics, grouped by city, age group, and marital status

CREATE OR REPLACE VIEW product_return_mart AS
SELECT p.product_id,
       p.product_name,
       COALESCE(SUM(pr.return_quantity), 0) AS total_returns,
       COALESCE(SUM(sd.order_quantity), 0) AS total_sales,
       CASE 
           WHEN COALESCE(SUM(sd.order_quantity), 0) = 0 THEN 0
           ELSE (COALESCE(SUM(pr.return_quantity), 0) / COALESCE(SUM(sd.order_quantity), 1)) * 100
       END AS return_rate_percentage
FROM products_lookup AS p
LEFT JOIN product_returns AS pr ON p.product_id = pr.product_key
LEFT JOIN sales_data AS sd ON p.product_id = sd.product_key
GROUP BY p.product_id, p.product_name
ORDER BY return_rate_percentage DESC;
-- Data mart for product returns, calculating total returns and return rate per product

CREATE OR REPLACE VIEW monthly_sales_mart AS
SELECT DATE_FORMAT(order_date, '%Y-%m') AS month, 
       SUM(order_quantity) AS total_quantity_sold,
       SUM(order_quantity * p.product_price) AS total_revenue
FROM sales_data AS sd
JOIN products_lookup AS p ON sd.product_key = p.product_id
GROUP BY month
ORDER BY month;
-- Data mart for monthly sales trends, aggregating sales quantity and revenue by month

-- Query each data mart to validate the results
